export const INITIALQUESTIONS = [
    {
      id: "question1",
      question: "¿Cuál es el objetivo de desarrollar tu marca personal?",
    },
    {
      id: "question2",
      question: "¿Cuál es tu cargo actual y a qué instituciones o empresas representas?  ",
    },
    {
      id: "question3",
      question: "¿Cómo impacta tu labor actual en la sociedad, tu trabajo en la empresa?",
    },
    { 
      id: "question4", 
      question: "¿Cuántos años de experiencia profesional en general posees?" 
    },
    {
      id: "question5",
      question: "¿Cuáles crees que son las habilidades o características que crees que te diferencian? Menciona las 3 principales.",
    },
    {
      id: "question6",
      question: "¿A qué públicos quieres dirigirte? Menciona 3",
    },
  ];
